import React from 'react';

const video = (props) => {


  return(
    <div className="videoWrapper">
      <div className="videoThumbnail"></div>
      <div className="videoTextBox">
        <span className="videoTextTitle"></span>
        <span className="videoTextOwner"></span>
      </div>
      <iframe width="560" height="315" src="https://www.youtube.com/embed/Jt_e7QG5L2U" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
  );
  };

export default video;
